import {
    IonButton,
} from "@ionic/react";
import { IonRouterOutlet } from "@ionic/react";
import { Route, Redirect } from "react-router-dom";
import Course from '../admin/quiz/Course';
const ViewCourseRoute: React.FC = () => {
    return (
        <IonRouterOutlet>

            <Route path="/dashboard/mycourse/:id/topic" exact component={Course} />
            <Route path="/dashboard/mycourse/:id/quiz" exact component={Course} />
            <Route path="/dashboard/mycourse/:id/level" exact component={Course} />


        </IonRouterOutlet>
    );
};

export default ViewCourseRoute;
